      [name]: value
    });
  };

  handleSubmit = e => {
    e.preventDefault();
    alert(this.state.fname);
  };

  render() {
    return (
      <div>
        <form onSubmit={this.handleSubmit}>
          <div className="form-group row">
            <label className="col-4"></label>
            <div className="col-8">
              <input
                onChange={this.handleChange}
                id="fname"
                name="fname"
                placeholder="First Name"
                type="text"
                className="form-control"
              />
            </div>
          </div>
          <div className="form-group row">
            <label className="col-4"></label>
            <div className="col-8">
              <input
                onChange={this.handleChange}
                id="lname"
                name="lname"
                placeholder="Last Name"
                type="text"
                className="form-control"
              />
            </div>
          </div>
          <div className="form-group row">
            <label className="col-4"></label>
            <div className="col-8">
              <input
                onChange={this.handleChange}
                id="pass"
                name="pass"
                placeholder="Enter Your Password"
                type="password"
                className="form-control"
              />
            </div>
          </div>
          <div className="form-group row">
            <label className="col-4"></label>
            <div className="col-8">
              <input
                id="pass"
                name="pass"
                placeholder="Repeat Your Password"
                type="password"
                className="form-control"
              />
            </div>
          </div>
          <div className="form-group row">
            <div className="offset-4 col-8">
              <button name="submit" type="submit" className="btn btn-primary">
                Submit
              </button>
            </div>
          </div>
        </form>
      </div>
    );
  }
}
